import datetime
import os
import unittest
from collections import UserList

from hessian2 import dumps, loads


class Test(unittest.TestCase):
    def test_encode_None(self):
        self.assertEqual(dumps(None), b'N')

    def test_decode_None(self):
        self.assertIsNone(loads(b'N'))

    def test_encode_boolean(self):
        self.assertEqual(dumps(True), b'T')
        self.assertEqual(dumps(False), b'F')

    def test_decode_boolean(self):
        self.assertTrue(loads(b'T'))
        self.assertFalse(loads(b'F'))

    def test_encode_int(self):
        self.assertEqual(dumps(0), b'\x90')
        self.assertEqual(dumps(1), b'\x91')
        self.assertEqual(dumps(16), b'\xa0')
        self.assertEqual(dumps(1000), b'\xcb\xe8')
        self.assertEqual(dumps(16000), b'\xd4\x3e\x80')
        self.assertEqual(dumps(-65000), b'\xd3\x02\x18')
        self.assertEqual(dumps(500000), b'\x49\x00\x07\xa1\x20')
        self.assertEqual(dumps(80000000000), b'\x4c\x00\x00\x00\x12\xa0\x5f\x20\x00')
        self.assertEqual(dumps(9000000000000000), b'\x4c\x00\x1f\xf9\x73\xca\xfa\x80\x00')
        self.assertEqual(dumps(-9000000000000000000), b'\x4c\x83\x19\x93\xaf\x1d\x7c\x00\x00')
        self.assertEqual(dumps(-0x10), b'\x80')
        self.assertEqual(dumps(0x2f), b'\xbf')
        self.assertEqual(dumps(-0x800), b'\xc0\x00')
        self.assertEqual(dumps(0x7ff), b'\xcf\xff')
        self.assertEqual(dumps(-0x40000), b'\xd0\x00\x00')
        self.assertEqual(dumps(0x3ffff), b'\xd7\xff\xff')
        self.assertEqual(dumps(-2147483648), b'\x49\x80\x00\x00\x00')
        self.assertEqual(dumps(2147483647), b'\x49\x7f\xff\xff\xff')
        self.assertEqual(dumps(-9223372036854775808), b'\x4c\x80\x00\x00\x00\x00\x00\x00\x00')
        self.assertEqual(dumps(9223372036854775807), b'\x4c\x7f\xff\xff\xff\xff\xff\xff\xff')

    def test_decode_int(self):
        self.assertEqual(loads(b'\x90'), 0)
        self.assertEqual(loads(b'\x91'), 1)
        self.assertEqual(loads(b'\xa0'), 16)
        self.assertEqual(loads(b'\xcb\xe8'), 1000)
        self.assertEqual(loads(b'\xd4\x3e\x80'), 16000)
        self.assertEqual(loads(b'\xd3\x02\x18'), -65000)
        self.assertEqual(loads(b'\x49\x00\x07\xa1\x20'), 500000)
        self.assertEqual(loads(b'\x4c\x00\x00\x00\x12\xa0\x5f\x20\x00'), 80000000000)
        self.assertEqual(loads(b'\x4c\x00\x1f\xf9\x73\xca\xfa\x80\x00'), 9000000000000000)
        self.assertEqual(loads(b'\x4c\x83\x19\x93\xaf\x1d\x7c\x00\x00'), -9000000000000000000)
        self.assertEqual(loads(b'\x80'), -0x10)
        self.assertEqual(loads(b'\xbf'), 0x2f)
        self.assertEqual(loads(b'\xc0\x00'), -0x800)
        self.assertEqual(loads(b'\xcf\xff'), 0x7ff)
        self.assertEqual(loads(b'\xd0\x00\x00'), -0x40000)
        self.assertEqual(loads(b'\xd7\xff\xff'), 0x3ffff)
        self.assertEqual(loads(b'\x49\x80\x00\x00\x00'), -2147483648)
        self.assertEqual(loads(b'\x49\x7f\xff\xff\xff'), 2147483647)
        self.assertEqual(loads(b'\x4c\x80\x00\x00\x00\x00\x00\x00\x00'), -9223372036854775808)
        self.assertEqual(loads(b'\x4c\x7f\xff\xff\xff\xff\xff\xff\xff'), 9223372036854775807)

    def test_encode_float(self):
        self.assertEqual(dumps(0.0), b'\x5b')
        self.assertEqual(dumps(1.0), b'\x5c')
        self.assertEqual(dumps(3.0), b'\x5d\x03')
        self.assertEqual(dumps(-1.0), b'\x5d\xff')
        self.assertEqual(dumps(127.0), b'\x5d\x7f')
        self.assertEqual(dumps(-128.0), b'\x5d\x80')
        self.assertEqual(dumps(300.0), b'\x5e\x01\x2c')
        self.assertEqual(dumps(10000.0), b'\x5e\x27\x10')
        self.assertEqual(dumps(3.14), b'\x5f\x00\x00\x0c\x44')
        self.assertEqual(dumps(3.1415926), b'\x44\x40\x09\x21\xfb\x4d\x12\xd8\x4a')

    def test_decode_float(self):
        self.assertEqual(loads(b'\x5b'), 0.0)
        self.assertEqual(loads(b'\x5c'), 1.0)
        self.assertEqual(loads(b'\x5d\x03'), 3.0)
        self.assertEqual(loads(b'\x5d\xff'), -1.0)
        self.assertEqual(loads(b'\x5d\x80'), -128.0)
        self.assertEqual(loads(b'\x5e\x01\x2c'), 300.0)
        self.assertEqual(loads(b'\x5e\x27\x10'), 10000.0)
        self.assertEqual(loads(b'\x5e\x80\x00'), -32768.0)
        self.assertAlmostEqual(loads(b'\x5f\x00\x00\x0c\x44'), 3.14, places=6)
        self.assertAlmostEqual(loads(b'\x44\x40\x09\x21\xfb\x4d\x12\xd8\x4a'), 3.1415926, places=7)
        self.assertAlmostEqual(loads(b'\x44\x3f\xf1\x99\x99\x99\x99\x99\x9a'), 1.1, places=15)

    def test_encode_binary(self):
        self.assertEqual(dumps(b''), b'\x20')
        self.assertEqual(dumps(b'\x00'), b'\x21\x00')
        self.assertEqual(dumps(b'\xff'), b'\x21\xff')
        self.assertEqual(dumps(b'hello'), b'\x25\x68\x65\x6c\x6c\x6f')
        self.assertEqual(dumps(b'a' * 15), b'\x2f' + b'\x61' * 15)
        self.assertEqual(dumps(b'a' * 16), b'\x34\x10' + b'\x61' * 16)
        self.assertEqual(dumps(b'a' * 127), b'\x34\x7f' + b'\x61' * 127)
        self.assertEqual(dumps(b'a' * 128), b'\x34\x80' + b'\x61' * 128)
        self.assertEqual(dumps(b'a' * 1023), b'\x37\xff' + b'\x61' * 1023)
        self.assertEqual(dumps(b'a' * 1024), b'\x42\x04\x00' + b'\x61' * 1024)
        self.assertEqual(dumps(b'a' * 4096), self._read_file('long_bytes_4096.txt'))
        self.assertEqual(dumps(b'a' * 5000), self._read_file('long_bytes_5000.txt'))
        self.assertEqual(dumps(b'a' * 65535), self._read_file('long_bytes_65535.txt'))

    def test_decode_binary(self):
        self.assertEqual(loads(b'\x20'), b'')
        self.assertEqual(loads(b'\x21\x00'), b'\x00')
        self.assertEqual(loads(b'\x21\xff'), b'\xff')
        self.assertEqual(loads(b'\x25\x68\x65\x6c\x6c\x6f'), b'hello')
        self.assertEqual(loads(b'\x2f' + b'\x61' * 15), b'a' * 15)
        self.assertEqual(loads(b'\x34\x10' + b'\x61' * 16), b'a' * 16)
        self.assertEqual(loads(b'\x34\x7f' + b'\x61' * 127), b'a' * 127)
        self.assertEqual(loads(b'\x34\x80' + b'\x61' * 128), b'a' * 128)
        self.assertEqual(loads(b'\x37\xff' + b'\x61' * 1023), b'a' * 1023)
        self.assertEqual(loads(b'\x42\x04\x00' + b'\x61' * 1024), b'a' * 1024)
        self.assertEqual(loads(self._read_file('long_bytes_4096.txt')), b'a' * 4096)
        self.assertEqual(loads(self._read_file('long_bytes_5000.txt')), b'a' * 5000)
        self.assertEqual(loads(self._read_file('long_bytes_65535.txt')), b'a' * 65535)

