    def test_decode_string(self):
        self.assertEqual(loads(b'\x00'), '')
        self.assertEqual(loads(b'\x05\x68\x65\x6c\x6c\x6f'), 'hello')
        self.assertEqual(loads(b'\x30\x80' + b'\x61' * 128), 'a' * 128)
        self.assertEqual(loads(b'\x04\xe4\xb8\xad\xe6\x96\x87\xe6\xb5\x8b\xe8\xaf\x95'), '‰∏≠ÊñáÊµãËØï')
