        self.assertEqual(loads(b'\x53\x0c\x00' + b'\x61\x62\x63' * 1024), 'abc' * 1024)
        self.assertEqual(loads(b'\x53\x80\x00' + b'\xe5\x95\x8a' * 32768), 'Âïä' * 32768)
        self.assertEqual(loads(self._read_file('long_str1.txt')), 'helloworldÊàë‰∫∫ÊúâÁöÑÂíå' * 80000)
