    def test_encode_date(self):
        self.assertEqual(dumps(datetime.datetime(2021, 2, 3, 11, 22, 33)), b'\x4a\x00\x00\x01\x77\x65\xe9\xbc\xa8')

    def test_decode_date(self):
        decoded = loads(b'\x4a\x00\x00\x01\x77\x65\xe9\xbc\xa8')
        self.assertEqual(decoded, datetime.datetime(2021, 2, 3, 11, 22, 33))

    def test_encode_list(self):
        self.assertEqual(dumps([]), b'\x78')
        self.assertEqual(dumps([1]), b'\x79\x91')
        self.assertEqual(dumps(['a']), b'\x79\x01\x61')
        self.assertEqual(dumps([1, 2, 3]), b'\x7b\x91\x92\x93')
        self.assertEqual(dumps(['a', 'b', 'c']), b'\x7b\x01\x61\x01\x62\x01\x63')
        self.assertEqual(dumps([b'abc']), b'\x79\x23\x61\x62\x63')
        self.assertEqual(dumps([b'a', b'b', b'c']), b'{!a!b!c')
        self.assertEqual(dumps([0] * 7), b'\x7f' + b'\x90' * 7)
        self.assertEqual(dumps([1] * 7), b'\x7f' + b'\x91' * 7)
        self.assertEqual(dumps([1, 'a', True]), b'\x7b\x91\x01\x61\x54')
        self.assertEqual(dumps([[1], [2]]), b'\x7a\x79\x91\x79\x92')
        self.assertEqual(dumps([True, False]), b'\x7a\x54\x46')
        self.assertEqual(dumps([None, None]), b'\x7a\x4e\x4e')
        self.assertEqual(dumps([1.0, 2.5]), b'\x7a\x5c\x5f\x00\x00\x09\xc4')
        self.assertEqual(dumps([1000, 2000]), b'\x7a\xcb\xe8\xcf\xd0')
        self.assertEqual(dumps(['√º']), b'\x79\x01\xc3\xbc')
        self.assertEqual(dumps([b'\x01\x02']), b'\x79\x22\x01\x02')

        self.assertEqual(dumps([1, 2, 3]), b'\x7b\x91\x92\x93')
        self.assertEqual(dumps(['a', 'b', 'c']), b'\x7b\x01\x61\x01\x62\x01\x63')
        self.assertEqual(dumps([True, False, True]), b'\x7b\x54\x46\x54')
